import React from "react";
import StatsCourseDetailListItem from "./item";

const coursestats_data = [
  {
    id: "1",
    name: "User Experience1",
    topic: "Design",
    skill: "UX, DESIGN",
    start_count: 12,
    incomplete_count: 5,
    complete_count: 20
  },
  {
    id: "2",
    name: "User Experience1",
    topic: "Design",
    skill: "UX, DESIGN",
    start_count: 12,
    incomplete_count: 5,
    complete_count: 20
  },
  {
    id: "3",
    name: "User Experience1",
    topic: "Design",
    skill: "UX, DESIGN",
    start_count: 12,
    incomplete_count: 5,
    complete_count: 20
  },
  {
    id: "4",
    name: "User Experience1",
    topic: "Design",
    skill: "UX, DESIGN",
    start_count: 12,
    incomplete_count: 5,
    complete_count: 20
  },
  {
    id: "5",
    name: "User Experience1",
    topic: "Design",
    skill: "UX, DESIGN",
    start_count: 12,
    incomplete_count: 5,
    complete_count: 20
  }
];

function StatsCourseDetailList() {
  const statscoursedetaillist = coursestats_data.map(item => (
    <StatsCourseDetailListItem
      key={item.id}
      statsCourseListItem={item}
    ></StatsCourseDetailListItem>
  ));
  return <div>{statscoursedetaillist}</div>;
}

export default StatsCourseDetailList;
